style.css:
/* Reset some default styles */
body, h1, h2, p, a {
    margin: 0;
    padding: 0;
}

/* Set a background color and font for the body */
body {
    background-color: #f4f4f4;
    font-family: 'Arial', sans-serif;
    color: #333;
}

/* Style headings */
h1 {
    color: #4285f4;
}

h2 {
    color: #34a853;
}

/* Style paragraphs */
p {
    line-height: 1.6;
}

/* Style links */
a {
    color: #4285f4;
    text-decoration: none;
}

a:hover {
    text-decoration: underline;
}
